.switch { --line:#505162; --dot:#009c44; --circle:#9EA0BE; --duration:0.3s; --text:#9EA0BE; display: block; height: 16px; }
.switch input { display: none; }
.switch input + div { position: relative; display: inline-block; }
.switch input + div::before, .switch input + div::after { --s:1; content: ""; position: absolute; height: 3px; top: 6px; width: 18px; background: var(--line); transform: scaleX(var(--s)); transition: all var(--duration) ease; }
.switch input + div::before { --s:0; left: 0px; transform-origin: 0px 50%; border-radius: 2px 0px 0px 2px; }
.switch input + div::after { left: 20px; transform-origin: 100% 50%; border-radius: 0px 2px 2px 0px; }
.switch input + div span { padding-left: 40px; line-height: 16px; color: var(--text); display: block; height: 16px; }
.switch input + div span::before { --x:0; --b:var(--circle); --s:3px; content: ""; position: absolute; left: 0px; top: 0px; width: 16px; height: 16px; border-radius: 50%; box-shadow: inset 0 0 0 var(--s) var(--b); transform: translateX(var(--x)); transition: all var(--duration) ease; }
.switch input + div span:not(:empty) { padding-left: 64px; }
.switch input:checked + div::before { --s:1; }
.switch input:checked + div::after { --s:0; }
.switch input:checked + div span::before { --x:22px; --s:12px; --b:var(--dot); }
.switch .switch-text { font-size: 0.8em; font-weight: 100; padding-left: 6px; position: relative; top: -4px; }
